import { PUPPY_LIST_REQUEST, PUPPY_LIST_SUCCESS, PUPPY_LIST_FAIL, PUPPY_DETAILS_REQUEST, PUPPY_DETAILS_SUCCESS, PUPPY_DETAILS_FAIL } from "../constants/puppyConstrants";

function puppyListReducer(state = { puppies: [] }, action) {

switch (action.type) {
    case PUPPY_LIST_REQUEST:
        return { loading: true};
    case PUPPY_LIST_SUCCESS:
        return { loading: false, puppies: action.payload };
    case PUPPY_LIST_FAIL:
        return { loading: false, error: action.payload }
    default:
        return state;
}
}
function puppyDetailsReducer(state = { puppy: {} }, action) {

    switch (action.type) {
        case PUPPY_DETAILS_REQUEST:
            return { loading: true};
        case PUPPY_DETAILS_SUCCESS:
            return { loading: false, puppy: action.payload };
        case PUPPY_DETAILS_FAIL:
            return { loading: false, error: action.payload }
        default:
            return state;
    }
    }
export { puppyListReducer, puppyDetailsReducer }
